import React from 'react'
import {AppBar, Tabs, Tab} from 'material-ui'

class Header extends React.Component {
  render() {
    return (
      <AppBar title="Image Gallery">
        <Tabs>
          <Tab label="Home" />
        </Tabs>
      </AppBar>
    )
  }
}

export default Header;
